      {"894f6c77-da14-43fc-959b-0ee8f1d5cbc6":{"version":"3.4.1","title":"Bokeh Application","roots":[{"type":"object","name":"Column","id":"p1411","attributes":{"children":[{"type":"object","name":"Column","id":"p1325","attributes":{"children":[{"type":"object","name":"Div","id":"p1324","attributes":{"text":"\n            &lt;p&gt; LE BRETON Paul &lt;/p&gt; \n            &lt;p&gt; MARSAC Gabin &lt;/p&gt;"}},{"type":"object","name":"Div","id":"p1321","attributes":{"styles":{"type":"map","entries":[["color","#3182bd"]]},"text":"&lt;h1&gt; Exploration des Parkings de Rennes M\u00e9tropole &lt;/h1&gt;"}},{"type":"object","name":"Div","id":"p1322","attributes":{"text":"\n&lt;p style=\"text-align: justify;\"&gt; Bienvenue sur notre page d\u00e9di\u00e9e \u00e0 l'exploration des parkings de Rennes et de sa m\u00e9tropole ! En partenariat avec les donn\u00e9es ouvertes de Rennes M\u00e9tropole, nous avons cr\u00e9\u00e9 cette plateforme interactive pour vous permettre de d\u00e9couvrir et d'analyser les informations relatives aux parkings de la r\u00e9gion.&lt;/p&gt;"}},{"type":"object","name":"Div","id":"p1323","attributes":{"text":"\n&lt;p style=\"text-align: justify;\"&gt; Les parkings sont un \u00e9l\u00e9ment crucial de la vie urbaine moderne, facilitant la mobilit\u00e9 et l'acc\u00e8s aux diff\u00e9rents services et activit\u00e9s dans une ville. Avec la croissance de la population et l'augmentation du nombre de v\u00e9hicules, la gestion efficace des parkings devient de plus en plus importante pour garantir une circulation fluide et un acc\u00e8s facile aux infrastructures.&lt;/p&gt;\n&lt;p style=\"text-align: justify;\"&gt;&amp;nbsp;&lt;/p&gt;\n&lt;p style=\"text-align: justify;\"&gt; Dans le cadre de cette exploration, nous nous pencherons sur les donn\u00e9es des parkings de Rennes M\u00e9tropole pour analyser diff\u00e9rents aspects, tels que la disponibilit\u00e9 des places, les tarifs de stationnement et la r\u00e9partition g\u00e9ographique des parkings. Cette analyse pourrait fournir des informations utiles aux responsables de la ville, aux urbanistes et aux citoyens pour am\u00e9liorer la gestion du stationnement dans la r\u00e9gion.&lt;/p&gt;\n&lt;p style=\"text-align: justify;\"&gt;&amp;nbsp;&lt;/p&gt;\n"}}]}},{"type":"object","name":"Tabs","id":"p1410","attributes":{"tabs":[{"type":"object","name":"TabPanel","id":"p1404","attributes":{"title":"Localisation et r\u00e9partition","child":{"type":"object","name":"GridPlot","id":"p1400","attributes":{"rows":null,"cols":null,"sizing_mode":"scale_both","toolbar":{"type":"object","name":"Toolbar","id":"p1399","attributes":{"tools":[{"type":"object","name":"PanTool","id":"p1132"},{"type":"object","name":"WheelZoomTool","id":"p1133","attributes":{"renderers":"auto"}},{"type":"object","name":"BoxZoomTool","id":"p1134","attributes":{"overlay":{"type":"object","name":"BoxAnnotation","id":"p1135","attributes":{"syncable":false,"level":"overlay","visible":false,"left":{"type":"number","value":"nan"},"right":{"type":"number","value":"nan"},"top":{"type":"number","value":"nan"},"bottom":{"type":"number","value":"nan"},"left_units":"canvas","right_units":"canvas","top_units":"canvas","bottom_units":"canvas","line_color":"black","line_alpha":1.0,"line_width":2,"line_dash":[4,4],"fill_color":"lightgrey","fill_alpha":0.5}}}},{"type":"object","name":"SaveTool","id":"p1398"},{"type":"object","name":"ResetTool","id":"p1141"},{"type":"object","name":"HelpTool","id":"p1142"},{"type":"object","name":"HoverTool","id":"p1225","attributes":{"renderers":"auto","tooltips":[["Nom","@nom"],["Nombre de Places","@nb_pl"],["Surfaces","@surface"]]}},{"type":"object","name":"HoverTool","id":"p1255","attributes":{"renderers":"auto","tooltips":"@country: @value (@percentage{0.0}%)"}},{"type":"object","name":"TapTool","id":"p1256","attributes":{"renderers":"auto"}}]}},"children":[[{"type":"object","name":"Figure","id":"p1110","attributes":{"sizing_mode":"scale_both","x_range":{"type":"object","name":"Data
